$(document).ready(function () {

    let signaturePad = createSignaturePad();
    resizeSignaturePad(signaturePad);

    let reasons = {
        reason_1: '1.interes profesional, inclusiv între locuință/gospodărie și locul/locurile de desfășurare a activității profesionale și înapoi.',
        reason_2: '2.asigurarea de bunuri care acoperă necesitățile de bază ale persoanelor și animalelor decompanie/domestice.',
        reason_3: '3.asistență medicală care nu poate fi amânată și nici realizată de la distanță.',
        reason_4: '4.motive justificate, precum îngrijirea/ însoțirea unui minor/copilului, asistența persoanelorvârstnice, bolnave sau cu dizabilități ori deces al unui membru de familie.',
        reason_5: '5.activitate fizică individuală (cu excluderea oricăror activități sportive de echipă/ colective)sau pentru nevoile animalelor de companie/domestice, în apropierea locuinței.',
        reason_6: '6.realizarea de activități agricole.',
        reason_7: '7.donarea de sânge, la centrele de transfuzie sanguină.',
        reason_8: '8.scopuri umanitare sau de voluntariat.',
        reason_9: '9.comercializarea de produse agroalimentare (în cazul producătorilor agricoli).',
        reason_10: '10.asigurarea de bunuri necesare desfășurării activității profesionale.',
    };

    let formAddressSameInput = $('#form_address_same');

    formAddressSameInput.on('change', function (event) {

        let isChecked = $(this).is(':checked');

        $('.js-form-residence :input:not(#form_address_same)').prop('disabled', isChecked);
    });

    $('#form-signature-clear').on('click', function () {

        signaturePad.clear();
    });

    $('form').on('submit', function (event) {

        event.preventDefault();

        let data = getFormData($('form'));

        let doc = createDoc(data);

        downloadDoc(doc, data.form_date);
    });

    $(window).on('resize', function () {

        resizeSignaturePad(signaturePad);
    });

    $('#form_date').datepicker({
        autoPick: true,
        format: 'dd.mm.yyyy',
        clearBtn: true
    });

    $('#form_dob_year').datepicker({
        autoPick: false,
        format: 'yyyy',
        clearBtn: true,
        maxDate: '2020.01.01'
    });

    $('#form_dob_month').datepicker({
        autoPick: false,
        format: 'mm',
        clearBtn: true,
        maxDate: '2020.01.01'
    });

    $('#form_dob_day').datepicker({
        autoPick: false,
        format: 'd',
        clearBtn: true,
        maxDate: '2020.01.01'
    });

    function getFormData($form) {

        let data = $form.serializeArray();
        let json = {};
        let reasons = [];

        $.map(data, function(item){
            if(item.name !== 'form_reason[]') {
                json[item.name] = item.value;      
            } else {
                reasons.push(item.value);
            } 
        });

        json.reasons = reasons;

        return json;
    }

    function createSignaturePad() {

        let canvas = $('canvas').get(0);

        return new SignaturePad(canvas);
    }

    function resizeSignaturePad(signaturePad) {

        let canvas = $('canvas').get(0);
        let ratio =  Math.max(window.devicePixelRatio || 1, 1);

        canvas.width = canvas.offsetWidth * ratio;
        canvas.height = canvas.offsetHeight * ratio;
        canvas.getContext('2d').scale(ratio, ratio);

        signaturePad.clear();
    }

    function createDoc(data) {

        let doc = new jsPDF();
        
        var imgData = 'data:image/jpeg;base64,';

        var checkIcon = 'data:image/png;base64,';

        var uncheckIcon = 'data:image/png;base64,';

        var pointText = '.';
        var dashText = '-';

        doc.setFontSize(13);
        doc.setFont('Roboto', 'bold');

        doc.text('DECLARAȚIE PE PROPRIE RĂSPUNDERE', 105, 30, { align: 'center' });
        doc.addImage(imgData, 'JPEG', 148, 6, 50, 20);

        doc.setFontSize(12);
        doc.setFont('Roboto', 'bold');

        doc.text('Nume, prenume:', 20, 40);
        doc.text('Data nașterii:', 20, 50);
        doc.text('Adresa locuinței:', 20, 60);
        doc.setFontSize(8);
        doc.setFont('Roboto', 'normal');
        doc.text('Se va completa adresa locuinței în care persoana locuiește în fapt, indiferent dacă este identică', 55, 70);
        doc.text('sau nu cu cea menționată în actul de identitate.', 55, 75);
        doc.setFontSize(12);
        doc.setFont('Roboto', 'bold');
        doc.text('Locul/locurile deplasării:', 20, 88);
        doc.setFontSize(8);
        doc.setFont('Roboto', 'normal');
        doc.text('Se vor menționa locurile în care persoana se deplasează, în ordinea în care aceasta intenționează să-și desfășoare traseul.', 20, 105);
        doc.setFontSize(12);
        doc.setFont('Roboto', 'bold');
        doc.text('Motivul deplasării:', 20, 126);
        doc.setFontSize(8);
        doc.setFont('Roboto', 'normal');
        doc.text('Se va bifa doar motivul/motivele deplasării dintre cele prevăzute în listă, nefiind permise deplasări realizate invocând', 26, 230);
        doc.text('alte motive decât cele prevăzute în Ordonanța Militară nr. 3/2020', 26, 235);
        doc.setFontSize(12);
        doc.setFont('Roboto', 'bold');
        doc.text('Data declarației:', 26, 260);
        doc.text(pointText.repeat(34), 60, 260);
        doc.text('Semnătura:', 114, 260);
        doc.text(pointText.repeat(40), 140, 260);

        doc.setFontSize(9);
        doc.text('Persoanele care au împlinit vârsta de 65 de ani completează doar pentru motivele prevăzute în campurile 1-6,', 20, 280), {renderingMode: 'fillThenStroke'};
        doc.text('deplasarea fiind permisă zilnic doar în intervalul orar 11.00 - 13.00.', 20, 284);

        doc.setFont('Roboto', 'normal');
        doc.setFontSize(12);

        doc.text(dashText.repeat(150), 25, 198);

        doc.setFontSize(10);

        doc.text(data.form_id_lastname + ' ' + data.form_id_firstname, 55, 40, { align: 'left' });
        doc.text(data.form_dob_day + ' - ' + data.form_dob_month + ' - ' + data.form_dob_year, 55, 50, { align: 'left' });
        doc.text(data.form_id_address, 55, 60, { align: 'left' });

        doc.text(data.form_move_places, 20, 94, { align: 'left' });
        
        var reasonsHeight = 133;
        $.each(reasons, function(index, value){
            doc.text(value, 25, reasonsHeight, { maxWidth: 180 });
            if(data.reasons.includes(index)) {
                doc.addImage(checkIcon, 'PNG', 19, (reasonsHeight - 4), 6, 6);
            } else {
                doc.addImage(uncheckIcon, 'PNG', 19, (reasonsHeight - 4), 6, 6);
            }
            if(index === 6) {
                reasonsHeight += 10;
            }
            reasonsHeight += 10;
        });

        doc.text(data.form_date, 65, 258);

        let signatureImage = signaturePad.toDataURL();

        doc.addImage(signatureImage, 'PNG', 135, 235, 70, 23);

        return doc.output('datauristring');
    }

    /**
     * 
     * @param {string} content - data uri string format 
     * @param {string} use_date - date for the document to be used 
     */
    function downloadDoc(content, use_date) {

        const downloadLink = document.createElement('a');
        let documentDate = use_date.split('.');
        const fileName = documentDate[2] + documentDate[1] + documentDate[0] + '-declaratie_pe_propria_raspundere.pdf';
    
        downloadLink.href = content;
        downloadLink.download = fileName;
        downloadLink.click();
    }
});